column8:
スペースを取らないシンプルなタイプ。<br><br>

猫ちゃんも喜ぶハウス・ねずみのおもちゃ付き！<br><br>

ポールにはロープが巻いてあり爪とぎにも使えます。<br><br>

台座はふわふわで居心地バツグン！いつもより大人しくなるかも。<br><br>

組立てかんたん！届いたその日からすぐに遊べて大満足！<br><br>

トップが延びて天井にしっかり突っ張れる。<br><br>

突っ張り部分には壁が傷まないよう嬉しいカバー付き！<br><br>

高さ：240cm～268cm<br><br>

材質：紙管、麻、パーティクルボード 他<br><br><!-- ↓ここからコンパス「共通説明文(大)」設置用HTMLタグです↓(※この文章も一緒にお貼り付けください。)

